import React from "react";
import { Chart } from "react-google-charts";

const StatTable = () => {
  const data = [
    ["Department", "Early","On Time", "Late"],
    ["Mon", 7, 2, 5],
    ["Tue", 8, 3 , 6],
    ["Wed", 6, 2, 3],
    ["Thu", 10, 4, 3],
    ["Fri", 9, 3],
  ];
  
  const options = {
    title: "Company Performance",
    curveType: "function",
    legend: { position: "bottom" },
  };
  return (
    <Chart
      chartType="LineChart"
      width="100%"
      height="400px"
      data={data}
      options={options}
    />
  );
};

export default StatTable;
